  18,\n\t\"tags\": [],\n\t\"title\": \"Dissolved inorganic carbon, alkalinity, temperature,
  salinity and other variables collected from discrete sample and profile observations
  using CTD, bottle and other instruments from the METEOR in the North Atlantic Ocean
  from 1992-05-09 to 1992-06-02 (NODC Accession 0115684)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-27T01:53:55.807084\",\n\t\"name\": \"dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-d73c12\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115684 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the North Atlantic
  Ocean from 1992-05-09 to 1992-06-02 and retrieved during cruise 06MT19920509 (06MT021/3).
  These data include ALKALINITY, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by J. Duinker of Institute Fuer Meereskunde,
  L. Mintrop of Marianda Marine Analytics and Data and K. Pegler of University of
  Hamburg; Center for Marine and Climate Research; Institute for Biogeochemistry and
  Marine Chemistry as part of the CARINA/06MT19920509 data set.nnThe CARINA (CARbon
  dioxide IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\":
